import logo from "./logo.svg";
import "./App.css";
import { useState, useEffect } from "react";

function App() {
  const [data, setData] = useState(null);
  const fetchUrl =
    "https://my-json-server.typicode.com/Codeinwp/front-end-internship-api/posts";
  const getData = () => fetch(`${fetchUrl}`).then((res) => res.json());

  useEffect(() => {
    getData().then((data) => setData(data));
  }, []);

  return (
    <div className="row">
      <div className="container">
        {data?.map((item, i) => {
          if (i % 2 == 0) {
            return (
              <ul>
                <div className="image">
                <li><img src = {item.thumbnail.small}/></li>
                </div>
                <h2><li>{item.title}</li></h2>
                <br></br>
                <div className="object_content">
                  <li>{item.content}</li>
                </div>
                <br></br>
                <br></br>
                <br></br>
              </ul>
            );
          }
        })}
      </div>
      <div className="container">
      {data?.map((item, i) => {
          if (i % 2 == 1)
            return (
              <ul>
                <div className="image">
                <li><img src = {item.thumbnail.small}/></li>
                </div>
                <h2><li>{item.title}</li></h2>
                <br></br>
                <div className="object_content">
                  <li>{item.content}</li>
                </div>
                <br></br>
                <br></br>
                <br></br>
              </ul>
            );
        })}
      </div>
    </div>
  );
}

export default App;
